import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class AuthorizationService {

  constructor() { }

  openAuthWindow(isRegistrationOpen : boolean) : void {
    isRegistrationOpen = true;
  }
}
